export class test extends Component {
  render() {
    return (
      <div>
        <h1 id="header">Hello Teanage America!</h1>
        <p>My name is Miss Anabella and I'm here to teach you German for dummies.</p>
        <p>Baa, bee, boo, baa, boo!</p>
      </div>
    )
  }
}

export default test
